`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?image ?webpage ?person ?personLabel WHERE {
?person wdt:[property:instance of] wd:[entity:human].
?person wdt:[property:The Washington Post contributor ID] ?id.
wd:[property:The Washington Post contributor ID] wdt:[property:formatter URL] ?url .
BIND(IRI(REPLACE(?id, '^(.+)$', ?url)) AS ?webpage).
OPTIONAL { ?person wdt:[property:image] ?image. }
SERVICE wikibase:label { bd:serviceParam wikibase:language "en, fr". }
}`

`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?org ?orgLabel ?portal ?portalLabel (SAMPLE(?coord) as ?coord) (SAMPLE(?img) as ?img) WHERE {
# ?portal wdt:[property:instance of] wd:[entity:open data portal].
?org wdt:[property:open data portal] ?portal.
?org wdt:[property:location]?/wdt:[property:coordinate location] ?coord.
OPTIONAL { ?org wdt:[property:flag image] ?flag }
OPTIONAL { ?org wdt:[property:coat of arms image] ?coat }
OPTIONAL { ?org wdt:[property:logo image] ?logo }
OPTIONAL { ?org wdt:[property:image] ?image }
BIND( COALESCE(?flag, ?coat, ?logo, ?image) as ?img )
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
}
GROUP BY ?org ?orgLabel ?portal ?portalLabel`
